import Link from "next/link";

const Navbar = () => (
<div>
<ul>
<li><Link href="/"><a>Home</a></Link></li>
<li><Link href="/about"><a>About</a></Link></li>
</ul>

<style jsx>{`
ul{
    background: gray;
    height: 50px;
    color: white;
    list-style: none;
    display: flex;
    justify-content: flex-end;
}
 ul li{
     font-size: 18px;
     
 }
 ul li a {
     color: white;
     text-decoration: none;
 }
`}</style>
</div>


)

export default Navbar;
